jQuery((function(t){async function n(n){n.preventDefault();const e=t("#crosswordengine_insert_shortcode_modal_content");e.html("Fetching crosswords...");try{const n=await jQuery.get("/wp-json/crosswordengine/v1/crosswords");e.html(`<table>\n                <tr>\n                    <th>Date</th>\n                    <th>Title</th>\n                    <th>Insert</th>\n                </tr>\n                ${n.map((t=>`\n                    <tr>\n                        <td>${new Date(t.date).toUTCString()}</td>\n                        <td>${t.title}</td>\n                        <td>\n                            <a href="#" data-id="${t.id}" class="crosswordengine_insert_shortcode_insert">Insert</button>\n                        </td>\n                    </tr>\n                `)).join("")}\n            </table>`),t(".crosswordengine_insert_shortcode_insert").click((n=>{const e=`[crosswordengine id="${t(n.target).data("id")}"]`;wp.media.editor.insert(e)}))}catch(t){e.html("There was an error fetching the crosswords."),console.error(t)}}t(document).ready((function(){t("#crosswordengine_media_button").click(n)}))}));